import { useState } from 'react'
import './App.css'

function App() {
	const [data, setData] = useState({})
	const [currentPage, setCurrentPage] = useState(0)

	const getAllContacts = async (page = 0, size = 10) => {
		try {
			setCurrentPage(page)
      await getAllContacts
		} catch (error) {
			console.log(error)
		}
	}

	return (
		<div>
			<h1>Hello</h1>
		</div>
	)
}

export default App
